import React from 'react';
import {Navbar} from "react-bootstrap";
import './nav.css'

const Navibar = () => {
    return (
        <Navbar>
            <div className='container'>
                <a className="company_logo" href="#">HUY
                </a>
            </div>
        </Navbar>
    );
};

export default Navibar;
